import React, { useState, useEffect } from "react";
import { motion } from "framer-motion";

const size = 400;
const dotsCount = 32; // total dots including lion face mane and inner fixed dots
const radius = 120;

// Helper: circle layout
const getCirclePos = (index, total, radius) => {
  const angle = (index / total) * 2 * Math.PI;
  return {
    x: size / 2 + radius * Math.cos(angle),
    y: size / 2 + radius * Math.sin(angle),
  };
};

// Helper: diamond layout (8 dots in diamond + repeat dots for full count)
const diamondPoints = [
  { x: 0, y: -radius },
  { x: radius / Math.SQRT2, y: -radius / Math.SQRT2 },
  { x: radius, y: 0 },
  { x: radius / Math.SQRT2, y: radius / Math.SQRT2 },
  { x: 0, y: radius },
  { x: -radius / Math.SQRT2, y: radius / Math.SQRT2 },
  { x: -radius, y: 0 },
  { x: -radius / Math.SQRT2, y: -radius / Math.SQRT2 },
];
const getDiamondPos = (index) => {
  const point = diamondPoints[index % 8];
  return { x: size / 2 + point.x, y: size / 2 + point.y };
};

// Helper: all center
const getCenterPos = () => ({ x: size / 2, y: size / 2 });

// Lion face coordinates and coloring for 32 dots (example positions, adjust as needed)
const lionDots = [
  // Black fixed inner face dots (index 0-7)
  { x: 200, y: 180, fixed: true },
  { x: 170, y: 160, fixed: true },
  { x: 230, y: 160, fixed: true },
  { x: 150, y: 220, fixed: true },
  { x: 250, y: 220, fixed: true },
  { x: 190, y: 140, fixed: true },
  { x: 210, y: 140, fixed: true },
  { x: 200, y: 230, fixed: true },

  // Gradient mane dots (index 8-31)
  ...[...Array(24)].map((_, i) => {
    const angle = (i / 24) * 2 * Math.PI;
    return {
      x: 200 + 120 * Math.cos(angle),
      y: 200 + 120 * Math.sin(angle),
      fixed: false,
      colorHue: (i / 24) * 240, // 0 to 240 (red to blue)
    };
  }),
];

// Connections between dots (example; connect all inner face and ring mane dots)
const CONNECTIONS = [
  [0, 1], [0, 2], [1, 3], [2, 4], [3, 7], [4, 7], [1, 5], [2, 6], [5, 6], // Inside black dots
  // Connect mane ring sequentially
  ...Array(24)
    .fill()
    .map((_, i) => [8 + i, 8 + ((i + 1) % 24)]),
  // Connect face to mane (optional edges)
  [0, 8], [7, 20], [3, 15], [4, 18],
];

export default function AnimatedLionDots() {
  // 0 = circle, 1 = diamond, 2 = center, 3 = lion
  const [state, setState] = useState(0);

  useEffect(() => {
    const interval = setInterval(() => {
      setState((v) => (v + 1) % 4);
    }, 4000);
    return () => clearInterval(interval);
  }, []);

  const getPosByState = (i) => {
    if (state === 0) return getCirclePos(i, dotsCount, radius);
    if (state === 1) return getDiamondPos(i);
    if (state === 2) return getCenterPos();
    if (state === 3) return { x: lionDots[i].x, y: lionDots[i].y };
  };

  return (
    <svg width={size} height={size} style={{ background: "#fff", margin: "40px auto", display: "block" }}>
      {/* Draw dotted lines */}
      {CONNECTIONS.map(([a, b], idx) => (
        <motion.line
          key={idx}
          animate={{
            x1: getPosByState(a).x,
            y1: getPosByState(a).y,
            x2: getPosByState(b).x,
            y2: getPosByState(b).y,
          }}
          transition={{ duration: 2, type: "spring" }}
          stroke="#444"
          strokeWidth={1}
          strokeDasharray="4 6"
        />
      ))}

      {/* Dots */}
      {lionDots.map((dot, i) => (
        <motion.circle
          key={i}
          cx={getPosByState(i).x}
          cy={getPosByState(i).y}
          r={dot.fixed ? 8 : 6}
          fill={dot.fixed ? "#111" : `hsl(${dot.colorHue}, 85%, 60%)`}
          stroke="#fff"
          strokeWidth={1}
          animate={{
            cx: getPosByState(i).x,
            cy: getPosByState(i).y,
          }}
          transition={{ duration: 2, type: "spring" }}
        />
      ))}
    </svg>
  );
}
